export const setUsername = (username) => {
  return (dispatch) => {
    dispatch({
      type: "newuser",
      payload: username,
    });
  };
};

export const addMisstake = () => {
  return (dispatch) => {
    dispatch({
      type: "INCREMENT",
      payload: "",
    });
  };
};

export const addGuess = (guess) => {
  return (dispatch) => {
    dispatch({
      type: "CORRECT",
      payload: guess,
    });
  };
};

export const addQuote = (quote) => {
  return (dispatch) => {
    dispatch({
      type: "newQuote",
      payload: quote,
    });
  };
};
